'use strict';
let MessageType = require('./MessageType.js');
//@@DocBrief("The class for getting temporary session messages")
class GetTemporarySessionMessage {
    temporarySession;
    error;
    constructor() {
        this.temporarySession = null;
        this.error = null;
    }
    getTemporarySession() {
        return this.temporarySession;
    }
    getError() {
        return this.error;
    }
    getType() {
        return MessageType.GetTemporarySession;
    }
}
module.exports = GetTemporarySessionMessage
